import React from "react";
import {
  Link
} from "react-router-dom"; 

export function LinkList ({root, lis}) {
  let elements = [];
  lis.forEach((li, i) => {
    elements.push(
      <Link to={`${root}/${li.name}`}>
        <li key={i}>
          <h3>{li.name}</h3>
          <img src={li.thumb} alt={li.name}/>
        </li>
      </Link>
    );
  });
  return(
    <ul>
      {elements}
    </ul>
  );
}

